import React, { Component } from "react";

import "./App.css";
import "./Homepage.css";
import Image from "./Image.js";

class Homepage extends Component {

  render() {
    return (
      <div className="Homepage">
     <Image 
          imgSrc="https://user-images.githubusercontent.com/15258799/57022768-4612bb80-6c5a-11e9-820d-9f0532f92303.gif"
          />
      </div>
    );
  }
}

export default Homepage;
